import React, { Component } from 'react';
import Link from 'next/link';

class MainBanner extends Component {
    render() {
        return (
            <div className="main-banner">
                <div className="d-table">
                    <div className="d-table-cell">
                        <div className="container">
                            <div className="main-banner-content">
                                <h1>Operar es fácil, por eso tenemos distintos servicios para vos</h1>
                                <p>Opera, Transferi, Soña y hace crecer tus proyectos con nosotros.</p>
                                <p color="blue">#ElFuturoDeTuProyecto.</p>
                                <Link href="#">
                                    <a className="btn btn-primary">¡Comencemos!</a>
                                </Link>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        );
    }
}

export default MainBanner;
